import React from 'react';

const Button = ({ onClick, disabled, children }) => {
  return (
    <button
      onClick={onClick}
      disabled={disabled}
      style={{
        padding: '10px 20px',
        backgroundColor: disabled ? '#cbd5e0' : '#4a6cf7',
        color: 'white',
        border: 'none',
        borderRadius: '6px',
        fontSize: '16px',
        cursor: disabled ? 'not-allowed' : 'pointer',
        transition: 'background-color 0.2s',
        ':hover': {
          backgroundColor: disabled ? '#cbd5e0' : '#3755d3'
        }
      }}
    >
      {children}
    </button>
  );
};

export default Button;
